    <style>
        .instagram_container {
            position: relative;
            height: 730px;
            width: 600px;
            border: 2px solid #008000;
            border-radius: 5px;
            margin: 10px 0 10px 10px;
            overflow: none;
            display: inline-block;
        }
                .instagram_header, .instagram_footer {
            background-color: #fff;
            font-size: 18px;
            font-weight: 300;
            color: #292F33;
            font-family: Helvetica, Roboto, 'Segoe UI', Calibri, sans-serif;
        }
        .instagram_header {
            height: 40px;
            border-bottom: 1px solid rgba(15,70,100,.12);
        }
        .instagram_footer {
            height: 30px;
            font-size: 15px;
            border-top: 1px solid rgba(15,70,100,.12);
        }
        .instagram_header a:visited {
            color: #3b94d9 !important;
            text-decoration: none !important;
            outline: 0 !important;
        }
        .instagram_header a {
            color: #3b94d9 !important;
            text-decoration: none !important;
            outline: 0 !important;
        }
        .instagram_content {
            overflow-y: scroll;
            overflow-x: hidden;
            -webkit-overflow-scrolling: touch;
            width: 580px;
            height: 630px;
            padding: 10px;
        }
    </style>
